import React from 'react';
import { Routes, Route} from 'react-router-dom';
import Home from './pages/Home';
import About from './pages/About';
import Shop from './pages/Shop';
import Navbar from './pages/Navbar';
import './App.css';

function App() {
  return (
      <>
        <Navbar/>
        <Routes>
          <Route path='/' element={<Home
           headpara="Introducing Sale Sphere, a cutting-edge e-commerce platform that delivers products directly to your doorstep."
           head="Welcome to Sale Sphere." 
           headtwo="A better way to shop anywhere on Earth."
           headtwopara="This website offers you an elevated and more convenient shopping experience, allowing you to browse and make purchases with greater ease and satisfaction."
           btn="Shop"
           />}/>
          <Route path='/About' element={<About/>}/>
          <Route path='/Shop' element={<Shop/>}/>
        </Routes>
      </>
  );
}

export default App;
